ontentId\":\"9501b4d3-c7e2-48a1-b1e7-b54f544498fd\",\"metadata\":{\"contentType\":\"Label\",\"license\":\"U\"}},\"label\":\"<p>A group of lung cells is called lung tissue,</p>\\n\",\"pause\":false,\"displayType\":\"button\",\"buttonOnMobile\":false},{\"x\":26.917900403768506,\"y\":93.76498800959233,\"width\":10,\"height\":10,\"duration\":{\"from\":63,\"to\":67},\"libraryTitle\":\"Label\",\"action\":{\"library\":\"H5P.Nil 1.0\",\"params\":{},\"subContentId\":\"c071b2cd-7758-4b2f-b568-d26dbbc8f5ff\",\"metadata\":{\"contentType\":\"Label\",\"license\":\"U\"}},\"label\":\"<p>and bone cells joined together is called bone tissue.</p>\\n\",\"pause\":false,\"displayType\":\"button\",\"buttonOnMobile\":false},{\"x\":13.458950201884253,\"y\":93.52517985611512,\"width\":10,\"height\":10,\"duration\":{\"from\":68,\"to\":75},\"libraryTitle\":\"Label\",\"action\":{\"library\":\"H5P.Nil 1.0\",\"params\":{},\"subContentId\":\"8987c2f2-da9c-4ae0-a1de-ec28f58e67a5\",\"metadata\":{\"contentType\":\"Label\",\"license\":\"U\"}},\"label\":\"<p>When a group of tissues that perform a specific function join together, they form organs.</p>\\n\",\"pause\":false,\"displayType\":\"button\",\"buttonOnMobile\":false},{\"x\":28.263795423956932,\"y\":93.76498800959233,\"width\":10,\"height\":10,\"duration\":{\"from\":76,\"to\":80},\"libraryTitle\":\"Label\",\"action\":{\"library\":\"H5P.Nil 1.0\",\"params\":{},\"subContentId\":\"97623b24-3bb9-4f47-aa07-b1db1f756b8a\",\"metadata\":{\"contentType\":\"Label\",\"license\":\"U\"}},\"label\":\"<p>Brain tissue comes together to make your brain.</p>\\n\",\"pause\":false,\"displayType\":\"button\",\"buttonOnMobile\":false},{\"x\":18.842530282637956,\"y\":93.52517985611512,\"width\":10,\"height\":10,\"duration\":{\"from\":81,\"to\":87},\"libraryTitle\":\"Label\",\"action\":{\"library\":\"H5P.Nil 1.0\",\"params\":{},\"subContentId\":\"47017c0a-e029-4c9f-8fd1-3f22f5e54968\",\"metadata\":{\"contentType\":\"Label\",\"license\":\"U\"}},\"label\":\"<p>Your brain i
